import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Redirect, Route} from "react-router-dom"

import Post from './Components/post/Post';



function App() {
  return (
    <div className="App">

      <Router>

        <Route path = {'/'} exact> 

        <Post />
        </Route>


      </Router>



    </div>
  );
}

export default App;
